import React from 'react';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

const iconStyle = { fontSize: '1.2rem' };

// Definindo componentes funcionais nomeados
const SearchIcon = React.memo(() => <BsSearch style={iconStyle} />);
const ChartIcon = React.memo(() => <BsBarChart style={iconStyle} />);
const GearIcon = React.memo(() => <BsGear style={iconStyle} />);
const FileIcon = React.memo(() => <BsFileText style={iconStyle} />);
const FilterIcon = React.memo(() => <BsFilter style={iconStyle} />);
const SaveIcon = React.memo(() => <BsSave style={iconStyle} />);
const TrashIcon = React.memo(() => <BsTrash style={iconStyle} />);

// Exportando os componentes
export {
  SearchIcon,
  ChartIcon,
  GearIcon,
  FileIcon,
  FilterIcon,
  SaveIcon,
  TrashIcon
};
